import java.util.concurrent.CopyOnWriteArraySet;
import java.util.HashSet;
import java.util.Set;

public class Main {
    public static void main(String[] args) {
        CopyOnWriteArraySet<Integer> set = new CopyOnWriteArraySet<>();
        Set<Integer> hashSet = new HashSet<>();

        // Adding elements to hashSet
        for (int i = 0; i < 5; i++) {
            hashSet.add(i * 10);
        }

        // Adding elements to set
        for (int i = 0; i < 5; i++) {
            set.add(i * 5);
        }

        /* write */ set.add(1);

        // Checking if hashSet contains elements from set
        for (Integer num : set) {
            if (hashSet.contains(num)) {
                System.out.println("HashSet contains: " + num);
            }
        }

        // Adding all elements from hashSet to set
        set.addAll(hashSet);

        // Iterating through set and printing elements
        for (Integer num : set) {
            System.out.println("Set contains: " + num);
        }

        /* read */ boolean contains = set.contains(1);
        System.out.println("Set contains 1: " + contains);
    }
}
